  false,\n\t\"url\": null,\n\t\"notes\": \"This Environmental Assessment (EA) addresses
  the aerial application of glyphosate to control Phragmites (Phragmites australis)
  on Bear River Migratory Bird Refuge.  The purpose of this EA is to analyze the environmental
  effects of alternatives for use in controlling Phragmites on Bear River Migratory
  Bird Refuge in northern Utah. Aerial application of glyphosate would be part of
  a larger integrated pest management plan for the control of Phragmites.  This EA
  contains the Environmental Action Statement, Finding of No Significant Impact, and
  Environmental Compliance Certificate concerning the application of glyphosate.\",\n\t\"license_title\":
